package com.sirelon.marsroverphotos.network

import android.content.Context
import com.google.gson.GsonBuilder
import com.readystatesoftware.chuck.ChuckInterceptor
import com.sirelon.marsroverphotos.models.INSIGHT
import com.sirelon.marsroverphotos.models.PhotosQueryRequest
import okhttp3.OkHttpClient
import okhttp3.Request
import retrofit2.Call
import retrofit2.Callback
import retrofit2.Response
import retrofit2.Retrofit
import retrofit2.adapter.rxjava2.RxJava2CallAdapterFactory
import retrofit2.converter.gson.GsonConverterFactory

/**
 * @author romanishin
 * @since 31.10.16 on 15:28
 */

class RestApi(context: Context) {
    private val nasaApi: NasaApi

    init {
        val okkClient = OkHttpClient.Builder()
            .addInterceptor(ChuckInterceptor(context))
            .build()

        val retrofit = Retrofit.Builder()
            .client(okkClient)
            .baseUrl("https://api.nasa.gov")
            .addConverterFactory(GsonConverterFactory.create())
            .addCallAdapterFactory(RxJava2CallAdapterFactory.create())
            .build()

        nasaApi = retrofit.create(NasaApi::class.java)
    }

    fun getRoversPhotos(query: PhotosQueryRequest): Call<PhotosResponse> {
        // We should call another api if rover is insight
        val sol = query.sol
        if (query.roverName.toLowerCase() == INSIGHT) {
            if (true)
                return getFakeRawPhotos()

            // TODO
            return nasaApi.getRawImages(fromSol = sol, toSol = sol)
        }
        return nasaApi.getRoverPhotos(query.roverName, sol, query.camera)
    }

    fun getRoverInfo(roverName: String): Call<RoverResponse> {
        return nasaApi.getRoverInfo(roverName)
    }


    private fun getFakeRawPhotos(): Call<PhotosResponse> {
        return object : Call<PhotosResponse> {
            override fun enqueue(callback: Callback<PhotosResponse>) {
                callback.onResponse(this, execute())
            }

            override fun isExecuted() = false
            override fun clone() = this

            override fun isCanceled() = false

            override fun cancel() {

            }

            override fun execute(): Response<PhotosResponse> {
                val gson = GsonBuilder().create()

                val photosResponse =
                    gson.fromJson<PhotosResponse>(FAKERESPONSE, PhotosResponse::class.java)

                return Response.success(photosResponse)
            }

            override fun request() = Request.Builder().build()
        }
    }


}


